---
version: "3"
services:
  geocluster:
    image: mietzekotze/james-geocluster
    environment:
      GOOGLE_API_KEY: CULPER.GPG_KEY.
      RABBIT_HOST: rabbit
    networks:
      - orwellcopter
  rabbit:
    image: "rabbitmq"
    environment:
      RABBITMQ_DEFAULT_USER: rabbitmq
      RABBITMQ_DEFAULT_PASS: CULPER.GPG_KEY.
    networks:
      - orwellcopter
  orwellcopter:
      image: mietzekotze/james-orwellcopter:20190122195037
      deploy:
        labels:
          - "traefik.docker.network=proxy"
          - "traefik.enable=true"
          - "traefik.frontend.rule=Host:orwellcopter.james.home"
          - "traefik.port=9000"
      environment:
        MQTT_USER: CULPER.GPG_KEY.
        MQTT_PASS: CULPER.GPG_KEY.
        MQTT_SERVER: CULPER.GPG_KEY.
        AMQP_USER: rabbitmq
        AMQP_PASS: CULPER.GPG_KEY.
        AMQP_SERVER: rabbit
        DB_URL: jdbc:postgresql://postgres_global/orwellcopter?loginTimeout=30&connectionTimeout=30
        DB_USER: orwellcopter 
        DB_PASS: CULPER.GPG_KEY.
        PLAY_SECRET: CULPER.GPG_KEY.
      networks:
        - orwellcopter
        - proxy
        
networks:
  orwellcopter:
    driver: bridge
  proxy:
    external:
      name: proxy
